import React from 'react';
import ReactDOM from 'react-dom/client';
import 'bootstrap/dist/css/bootstrap.min.css'; // Ensure bootstrap is installed
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Use Routes and Route
import './index.css';
import App from './App';
import RestaurantProfile from './components/restaurantProfile'; // Correct the path
import reportWebVitals from './reportWebVitals';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Router>
      <Routes>
        <Route path="/" element={<App />} />
        <Route path="/restaurant/:id" element={<RestaurantProfile />} />
      </Routes>
    </Router>
  </React.StrictMode>
);

reportWebVitals();
